(47, 1, '2018-01-31 20:04:08', '2018-01-31 22:04:08', '<p>Inplac North America Inc. was founded in September of 2003 and is 100% owned by Inplac Industria de Plasticos S/A, located in Biguacu, Brazil. Inplac North America serves as Inplac’s sales office in the United States.</p><br><br>\r\n\r\n<p>Inplac Industria de Plasticos S/A is a family owned business. It was founded in 1974 by Fernando Marcondes de Mattos, who is still the major shareholder of the company, and his brother Roberto Marcondes de Mattos, a mechanical engineer who serves as president of the company.</p>', 'About Us', 'A leader in the plastic valve bag market, Inplac offers a variety of flexible packaging solutions for your company.<br><br>Inplac is well known for both technological innovation and services. Various winning products and processes have been developed in a pioneering fashion.', 'publish', 'closed', 'closed', '', 'company', '', '', '2018-03-07 11:57:06', '2018-03-07 14:57:06', '', 0, 'http://localhost/inplacna/?page_id=47', 0, 'page', '', 0),
(160, 2, '2018-02-21 17:43:22', '2018-02-21 20:43:22', 'Inplac North America Inc. was founded in September of 2003 and is 100% owned by Inplac Industria de Plasticos S/A, located in Biguacu, Brazil. Inplac North America serves as Inplac’s sales office in the United States.\r\n\r\nInplac Industria de Plasticos S/A is a family owned business. It was founded in 1974 by Fernando Marcondes de Mattos, who is still the major shareholder of the company, and his brother Roberto Marcondes de Mattos, a mechanical engineer who serves as president of the company.', 'About Us', 'A leader in the plastic valve bag market, Inplac offers a variety of flexible packaging solutions for your company.<br><br>Inplac is well known for both technological innovation and services, various winning products and processes have been developed in a pioneering fashion. ', 'inherit', 'closed', 'closed', '', '47-revision-v1', '', '', '2018-02-21 17:43:22', '2018-02-21 20:43:22', '', 47, 'http://itismyweb.co/preview/di20/inplacna/47-revision-v1/', 0, 'revision', '', 0),
(48, 1, '2018-01-31 20:04:08', '2018-01-31 22:04:08', 'Inplac North America Inc. was founded in September of 2003 and is 100% owned by Inplac Industria de Plasticos S/A, located in Biguacu, Brazil. Inplac North America serves as\r\nInplac’s sales office in the United States.\r\n\r\nInplac Industria de Plasticos S/A is a family owned business. It was founded in 1974 by Fernando Marcondes de Mattos, who is still the major shareholder of the company, and his\r\nbrother Roberto Marcondes de Mattos, a mechanical engineer who serves as president of the company.', 'Company', '', 'inherit', 'closed', 'closed', '', '47-revision-v1', '', '', '2018-01-31 20:04:08', '2018-01-31 22:04:08', '', 47, 'http://localhost/inplacna/47-revision-v1/', 0, 'revision', '', 0),
