(43, 1, '2018-01-29 23:16:02', '2018-01-30 01:16:02', 'Este é o exemplo de uma página. É diferente de um post de blog porque é estática e pode aparecer em menus de navegação (na maioria dos temas). A maioria das pessoas começam com uma página ''Sobre'' que as apresenta aos potenciais visitantes do site. Você pode usar algo como:\n\n<blockquote>Oi! Sou um estudante de Biologia e gosto de esportes e natureza. Nos fins-de-semana pratico futebol com meus amigos no clube local. Eu moro em Valinhos e fiz este site para falar sobre minha cidade.</blockquote>\n\n...ou algo como:\n\n<blockquote>A empresa Logos foi fundada em 1980, e tem provido o comércio local com o que há de melhor em informatização. Localizada em Recife, nossa empresa tem se destacado como um das que também contribuem para o descarte correto de equipamentos eletrônicos substituídos.</blockquote>\n\nComo um novo usuário WordPress, vá ao seu <a href="http://localhost/inplacna/wp-admin/">Painel</a> para excluir este conteúdo e criar o seu. Divirta-se!', 'Home', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2018-01-29 23:16:02', '2018-01-30 01:16:02', '', 2, 'http://localhost/inplacna/2018/01/29/2-revision-v1/', 0, 'revision', '', 0),
