(49, 1, '2018-01-31 20:04:53', '2018-01-31 22:04:53', 'Inplac North America Inc. was founded in September of 2003 and is 100% owned by Inplac Industria de Plasticos S/A, located in Biguacu, Brazil. Inplac North America serves as\r\nInplac’s sales office in the United States.\r\n\r\nInplac Industria de Plasticos S/A is a family owned business. It was founded in 1974 by Fernando Marcondes de Mattos, who is still the major shareholder of the company, and his\r\nbrother Roberto Marcondes de Mattos, a mechanical engineer who serves as president of the company.', 'About Us', '', 'inherit', 'closed', 'closed', '', '47-revision-v1', '', '', '2018-01-31 20:04:53', '2018-01-31 22:04:53', '', 47, 'http://localhost/inplacna/47-revision-v1/', 0, 'revision', '', 0),
