(72, 1, '2018-01-31 23:38:28', '2018-02-01 01:38:28', 'Inplac North America Inc. was founded in September of 2003 and is 100% owned by Inplac Industria de Plasticos S/A, located in Biguacu, Brazil. Inplac North America serves as\r\nInplac’s sales office in the United States.\r\n\r\n\r\nInplac Industria de Plasticos S/A is a family owned business. It was founded in 1974 by Fernando Marcondes de Mattos, who is still the major shareholder of the company, and his brother Roberto Marcondes de Mattos, a mechanical engineer who serves as president of the company.', 'About Us', 'Leader in the plastic valve bag market, Inplac offers a variety of flexible packaging solutions for your company.<br><br>Inplac is well known for both technological innovation and services, various winning products and processes have been developed in a pioneering fashion. That is how the company grew and maintains a high level of development.', 'inherit', 'closed', 'closed', '', '47-revision-v1', '', '', '2018-01-31 23:38:28', '2018-02-01 01:38:28', '', 47, 'http://localhost/inplacna/47-revision-v1/', 0, 'revision', '', 0),
